const encodeConfig = (obj) => btoa(unescape(encodeURIComponent(JSON.stringify(obj))));
const decodeConfig = (b64) => { try { return JSON.parse(decodeURIComponent(escape(atob(b64)))) } catch(e) { return null; } };

const initialPrizes = [{'name': '加入我的多鄰國家族', 'emoji': '🤗'}, {'name': '付費版記帳軟體', 'emoji': '💰'}, {'name': '分享一個好秘密', 'emoji': '🍱'}, {'name': '一起去打匹克球', 'emoji': '🏃'}, {'name': '一起去體驗做陶', 'emoji': '☕️'}, {'name': '一個來自瑞士或倫敦的禮物', 'emoji': '🎁'}, {'name': '一起分享一個平凡的下午，剪一支短影片', 'emoji': '📸'}, {'name': '一次蓋洛普優勢測驗', 'emoji': '🌟'}, {'name': '一份專屬於孟函的戀愛歌單', 'emoji': '🎶'}];

const state = {
  title: '孟函 の 37 大壽抽抽樂',
  prizes: initialPrizes.map(p => ({...p})),
  allowRepeat: false,
  shuffleOnStart: true,
  coverDataUrl: 'data:image/jpeg;base64,', // placeholder; you can re-upload
  opened: new Set(),
};

const el = {
  cover: document.getElementById('cover'),
  game: document.getElementById('game'),
  grid: document.getElementById('grid'),
  titleInput: document.getElementById('gameTitle'),
  titleDisplay: document.getElementById('titleDisplay'),
  coverInput: document.getElementById('coverInput'),
  coverImage: document.getElementById('coverImage'),
  coverFallback: document.querySelector('.cover-image-fallback'),
  startBtn: document.getElementById('startBtn'),
  resetBtn: document.getElementById('resetBtn'),
  backBtn: document.getElementById('backBtn'),
  editBtn: document.getElementById('editPrizesBtn'),
  editDialog: document.getElementById('editDialog'),
  editGrid: document.getElementById('editGrid'),
  allowRepeat: document.getElementById('allowRepeat'),
  shuffleOnStart: document.getElementById('shuffleOnStart'),
  savePrizesBtn: document.getElementById('savePrizesBtn'),
  prizeDialog: document.getElementById('prizeDialog'),
  prizeEmoji: document.getElementById('prizeEmoji'),
  prizeName: document.getElementById('prizeName'),
  closePrizeBtn: document.getElementById('closePrizeBtn'),
  shareBtn: document.getElementById('shareBtn'),
  openedCount: document.getElementById('openedCount'),
  importBtn: document.getElementById('importBtn'),
  importDialog: document.getElementById('importDialog'),
  importText: document.getElementById('importText'),
  applyImportBtn: document.getElementById('applyImportBtn'),
};

function init(){
  if(location.hash.length > 1){ const conf = decodeConfig(location.hash.slice(1)); if(conf) Object.assign(state, conf); }
  el.titleInput.value = state.title || '';
  el.titleDisplay.textContent = state.title || '抽抽樂';
  if(state.coverDataUrl){ el.coverImage.src = state.coverDataUrl; el.coverImage.style.display = 'block'; el.coverFallback.style.display = 'none'; }
  renderEditGrid(); el.allowRepeat.checked = !!state.allowRepeat; el.shuffleOnStart.checked = state.shuffleOnStart !== false;
} document.addEventListener('DOMContentLoaded', init);

el.coverInput.addEventListener('change', (e)=>{ const file = e.target.files?.[0]; if(!file) return; const reader = new FileReader(); reader.onload = () => { state.coverDataUrl = reader.result; el.coverImage.src = state.coverDataUrl; el.coverImage.style.display = 'block'; el.coverFallback.style.display = 'none'; el.coverInput.value = ''; }; reader.readAsDataURL(file); });
el.editBtn.addEventListener('click', ()=>{ renderEditGrid(); el.editDialog.showModal(); });
el.startBtn.addEventListener('click', ()=>{ state.title = el.titleInput.value.trim() || '抽抽樂'; startGame(); });
el.importBtn.addEventListener('click', ()=>{ el.importText.value = ''; el.importDialog.showModal(); });
el.applyImportBtn?.addEventListener('click', (ev)=>{ if(ev.submitter?.value!=='apply') return; ev.preventDefault(); let text = el.importText.value.trim(); if(!text) return; const hash = text.includes('#')? text.split('#').pop() : text; const conf = decodeConfig(hash); if(!conf){ alert('解析失敗，請確認內容是否正確。'); return; } Object.assign(state, conf); el.titleInput.value = state.title || ''; if(state.coverDataUrl){ el.coverImage.src = state.coverDataUrl; el.coverImage.style.display = 'block'; el.coverFallback.style.display='none'; } renderEditGrid(); el.allowRepeat.checked=!!state.allowRepeat; el.shuffleOnStart.checked=state.shuffleOnStart!==false; el.importDialog.close(); });

function renderEditGrid(){
  el.editGrid.innerHTML = '';
  state.prizes.forEach((p, i)=>{ const row = document.createElement('div'); row.className = 'edit-item'; row.innerHTML = `<input type="text" class="name" placeholder="獎品名稱 #${i+1}" value="${p.name ?? ''}"/><input type="text" class="emoji" placeholder="Emoji" value="${p.emoji ?? ''}"/>`; el.editGrid.appendChild(row); });
}
el.savePrizesBtn.addEventListener('click', (ev)=>{ if(ev.submitter?.value!=='save') return; ev.preventDefault(); const rows = Array.from(el.editGrid.querySelectorAll('.edit-item')); const prizes = rows.map(r=>({name:r.querySelector('.name').value.trim()||'神秘獎品', emoji:r.querySelector('.emoji').value.trim()||'🎁'})); state.prizes = prizes.slice(0,9); state.allowRepeat = el.allowRepeat.checked; state.shuffleOnStart = el.shuffleOnStart.checked; el.editDialog.close(); });

function startGame(){
  state.opened = new Set(); el.openedCount.textContent = '0'; el.titleDisplay.textContent = state.title || '抽抽樂';
  const idx = [...Array(9).keys()]; const order = state.shuffleOnStart ? shuffle(idx) : idx; el.grid.innerHTML = '';
  order.forEach((i, cellIdx)=>{ const prize = state.prizes[i]; const card = createCard(cellIdx, prize); el.grid.appendChild(card); });
  showScreen('game');
}
function shuffle(a){ const arr=a.slice(); for(let i=arr.length-1;i>0;i--){ const j=Math.floor(Math.random()*(i+1)); [arr[i],arr[j]]=[arr[j],arr[i]]; } return arr; }
function createCard(cellIndex, prize){ const card = document.createElement('div'); card.className='card'; card.dataset.index=String(cellIndex); card.innerHTML = `<div class="back"><div class="label">點我抽！</div></div><div class="front" style="display:none;"><div class="prize"><div class="emoji">${escapeHtml(prize.emoji||'🎁')}</div><div class="name">${escapeHtml(prize.name||'神秘獎品')}</div></div></div><div class="shards"></div>`; prepareShards(card); card.addEventListener('click', ()=>{ if(card.classList.contains('opened')) return; shatter(card); reveal(card, prize); }); return card; }
function prepareShards(card){ const sds = card.querySelector('.shards'); sds.innerHTML=''; const pos = [[0,0],[1,0],[2,0],[0,1],[1,1],[2,1],[0,2],[1,2],[2,2]]; pos.forEach(([x,y])=>{ const s=document.createElement('div'); s.className='shard'; s.style.left=`${x*33.34}%`; s.style.top=`${y*33.34}%`; const tx=(Math.random()*160-80)+'px'; const ty=(Math.random()*-160-40)+'px'; const rot=(Math.random()*540-270)+'deg'; s.style.setProperty('--tx',tx); s.style.setProperty('--ty',ty); s.style.setProperty('--rot',rot); sds.appendChild(s); }); }
function shatter(card){ card.classList.add('break'); setTimeout(()=>{ card.querySelector('.shards').innerHTML=''; }, 950); }
function reveal(card, prize){ card.querySelector('.back').style.display='none'; card.querySelector('.front').style.display='grid'; card.classList.add('opened'); el.prizeEmoji.textContent = prize.emoji || '🎁'; el.prizeName.textContent = prize.name || '神秘獎品'; state.opened.add(card.dataset.index); el.openedCount.textContent = String(state.opened.size); el.prizeDialog.showModal(); }
el.closePrizeBtn.addEventListener('click', ()=> el.prizeDialog.close());
el.resetBtn.addEventListener('click', ()=>{ if(confirm('確定要重置？所有已開的獎會清空。')) startGame(); });
el.backBtn.addEventListener('click', ()=> showScreen('cover'));
function showScreen(name){ el.cover.classList.toggle('visible', name==='cover'); el.game.classList.toggle('visible', name==='game'); }
el.shareBtn.addEventListener('click', async ()=>{ const conf = { title: state.title, prizes: state.prizes, allowRepeat: !!state.allowRepeat, shuffleOnStart: !!state.shuffleOnStart, coverDataUrl: state.coverDataUrl || null, }; const hash = encodeConfig(conf); const url = location.origin + location.pathname + '#' + hash; try{ if(navigator.share){ await navigator.share({title: state.title || '抽抽樂', url}); } else { await navigator.clipboard.writeText(url); alert('已複製分享連結到剪貼簿！'); } }catch(e){ prompt('複製下面的分享連結：', url); } });
function escapeHtml(s){ return String(s).replace(/[&<>"']/g, c => ({'&':'&amp;','<':'&lt;','>':'&gt;','"':'&quot;',"'":'&#39;'})[c]); }
